import { Box, CircularProgress } from "@mui/material";
import React from "react";

const Loading = ({ height = "10vh" }) => {
  return (
    <Box
      display="flex"
      justifyContent="center"
      alignItems="center"
      height={height}
      sx={{ mt:3, mb:2 }}
    >
      <CircularProgress />
    </Box>
  );
};

export default Loading;
